import React from "react";

import "@fortawesome/fontawesome-free/css/all.css";
import "./App.css";
import Slider from "./components/Slider";

const slidesData = [
  {
    src: "./assets/imgs/assassinscreed.pnghttps://wallpapercg.com/media/ts_orig/13252.webp",
    alt: "Assassin's Creed",
    title: "Assassin's Creed",
    description: "Lorem ipsum dolor sit, amet consectetur adipisicing elit",
  },
  {
    src: "./assets/imgs/fortnite.png",
    alt: "Fortnite",
    title: "Fortnite",
    description: "Lorem ipsum dolor sit, amet consectetur adipisicing elit",
  },
  {
    src: "./assets/imgs/freefire.png",
    alt: "Freefire",
    title: "Freefire",
    description: "Lorem ipsum dolor sit, amet consectetur adipisicing elit",
  },
  // Adicione os outros slides aqui...
];

const App = () => {
  return (
    <div className="App">
      <Slider slidesData={slidesData} />
    </div>
  );
};

export default App;
